import React, { useEffect } from 'react';
import { Container, Grow, Grid, AppBar, TextField, Button, Typography } from '@material-ui/core';
import { useDispatch } from 'react-redux';

import { getPostsp } from '../../actions/postsp';

import Postsp from '../Postsp/Postsp';
import Formp from '../Formp/Formp';
import useStyles from './styles';

const Home = () => {
    const dispatch = useDispatch();

    useEffect(() => {
        dispatch(getPostsp());
    }, [dispatch]);

    const classes = useStyles();

    return (
        <Grow in>
            <Container maxWidth="xl">
                <AppBar position="static" color="inherit">
                    <Typography variant="h2" align="center">Steam Wash</Typography>
                </AppBar>
                <Grid container justify="space-between" alignItems="stretch" spacing={3} >
                    <Grid item xs={12} sm={6} md={9}>
                        <Postsp />
                    </Grid>
                    <Grid item xs={12} sm={6} md={3}>
                        <AppBar className={classes.appBarSearch} position="static" color="inherit">
                            <TextField name="search" variant="outlined" label="Search Memories" fullWidth />
                            <br />
                            <Button variant="contained" color="primary">Search</Button>
                        </AppBar>
                        <Formp />
                    </Grid>
                </Grid>
            </Container>
        </Grow>
    );
}

export default Home
